import React from 'react'
import { Helmet } from "react-helmet";
// import PlansandPricing from "./Realstate-plans/PlansandPricing";
// import SingleStandard from "./Realstate-plans/SingleStandard"; 
import CondoPlans from "./Realstate-plans/CondoPlans"
const Shop =()=>{
    return(
        <>
          <Helmet>
             <title>Arizona Resources - Acclaimed Home Warranty : Acclaimed Home Warranty</title>
             <meta name="description" content="Arizona Resources - Acclaimed Home Warranty" />
          </Helmet>
        <div>
            <h1>Shop</h1>
            {/* <PlansandPricing/>
            <SingleStandard/> */}
            <CondoPlans/>
        </div>
        </>
    )
}
export default Shop;
